package myungjun;

public class ComposerVO {
	private String composer_id;
	private String composer_name;
	private int rating_id;
	private int count;
	public ComposerVO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getComposer_id() {
		return composer_id;
	}
	public void setComposer_id(String composer_id) {
		this.composer_id = composer_id;
	}
	public String getComposer_name() {
		return composer_name;
	}
	public void setComposer_name(String composer_name) {
		this.composer_name = composer_name;
	}
	public int getRating_id() {
		return rating_id;
	}
	public void setRating_id(int rating_id) {
		this.rating_id = rating_id;
	}
	public int getCount() {
		return count;
	}
	public void setCount(int count) {
		this.count = count;
	}
	
}
